import React from 'react'
import styled from "styled-components"
const CounterUp = () => {
    return (
        <>
            <Wrapper>
                <div className='container'>
                    <div className='grid grid-three-column'>
                        <div className='content'>
                            <h1 className='main_heading'>Towards
                                Leading the Industry
                            </h1>
                            <h1>The credits goes to Ftechiz team for making this up to here.</h1>
                        </div>
                        <div style={{color:"white"}}><h1>200+</h1>Project</div>
                        <div style={{color:"white"}}><h1>300+</h1>Clients</div>
                    </div>
                </div>
            </Wrapper>
        </>
    )
}
const Wrapper = styled.section`
.container{
padding: 1rem 0;
background: ${({ theme }) => theme.colors.bg};
border-radius:1rem;
margin:8rem 12rem;
}
.grid {
    display: grid;
    gap: 2rem;
    margin: 3rem 3rem;
  }
  .grid-three-column{
    grid-template-column:repeat(3, 1fr);
  }
  .content{
    .main_heading{
        font-weight:520; 
        color:${({ theme }) => theme.colors.helper};
        margin-bottom:2rem; 
    }
    h1{
        ${'' /* line-height:1.3rem;  */}
    }
  }
`;

export default CounterUp;
